  }

  const handleSubmit = event => {
    event.preventDefault();
    const headers = {
        'uname': 'feutest1',
        'password': 'feutest1'
    }
    axios.get('/login', headers) 
        .then(res => {
            console.log(res);
        })    
  };

  const buttonText = register ? "login" : "Register Here"
  
  
