            <input name="password" type="password" onChange={handlePChange}/>
            </label>
            <br /><br />
            <input type="submit" value="Login"/>
        </form>
        }
        OR <br />
        <button onClick={ () => {
          setRegister(!register)
        }}>
          {buttonText}
        </button>
        </div>
        

      </div>
    )
}

export default Home
